sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new x_759224_magic_c_0.deck_utils();

    var deckArr = utils.parseDeck(inputs.deck_input);
    gs.info(JSON.stringify(deckArr));
    var deckRecord = utils.createDeckFromImport(inputs.import_record);
    utils.processCards(deckArr, deckRecord);
    
    outputs.deck = deckRecord;

})(inputs, outputs);

